var TwigFunctionMethod;

TwigFunctionMethod = (function() {
  function TwigFunctionMethod(method) {
    this.method = method;
  }

  TwigFunctionMethod.prototype.getMethod = function() {
    return this.method;
  };

  return TwigFunctionMethod;

})();

module.exports = TwigFunctionMethod;
